  `prod_cogs` double NULL DEFAULT NULL COMMENT 'Cost of goods sold',
  `prod_link` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'When users click on your product, they’re sent to a landing page on your website for that product. Set the URL for this landing page with the link [link] attribute.',
  `prod_mobile_link` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'The mobile link [mobile_link] attribute lets you include a URL to a mobile-optimized version of your landing page. This mobile version will be shown to users on mobile devices, like phones or tablets. When using this attribute, you’ll also see additional reporting in Merchant Center for potential issues with your mobile-optimized landing pages.',
