  `prod_additional_image_link` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Pattern -> [item|item|item]',
  `prod_cate_id` int NOT NULL COMMENT 'Caterogy',
  `prod_unit_pricing_measure_id` int NOT NULL,
  `prod_availability` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'in_stock' COMMENT 'in_stock, out_of_stock, preorder, backorder',
  `prod_availability_date` datetime NULL DEFAULT NULL COMMENT 'Use the availability date [availability_date] attribute to tell customers when a preordered or backordered product will be shipped.',
  `prod_expiration_date` datetime NULL DEFAULT NULL COMMENT 'Use the expiration date [expiration_date] attribute to cause a product to stop showing on a specific date. For example, you might want to do this for limited stock or seasonal products.',
  `prod_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'development' COMMENT 'draft, published (development, production)',
  `prod_description` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '	1–5,000 characters',
  `prod_created_at` datetime NOT NULL DEFAULT current_timestamp,
  `prod_updated_at` datetime NOT NULL DEFAULT current_timestamp,
