  `shipping_label` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '(oversize,\r\nperishable,\r\nsameday, free shipping)\r\n\r\n-Use the shipping label [shipping_label] attribute to group products together so that you can configure specific shipping rates in Merchant Center. The information you include in this attribute won’t be shown to customers.',
  `shipping_weight` float NOT NULL COMMENT 'Unit: kg',
  `shipping_width` float NOT NULL COMMENT 'Unit: cm',
  `shipping_height` float NOT NULL COMMENT 'Unit: cm',
  `shipping_length` float NOT NULL COMMENT 'Unit: cm',
  `shipping_min_handling_time` int NOT NULL COMMENT 'Use minimum handling time [min_handling_time] and maximum handling time [max_handling_time] to help us give users accurate information about how long it will take for a product to arrive at its destination. Maximum and minimum handling time are the longest and shortest amounts of time between when an order is placed and when the product ships.',
  `shipping_max_handling_time` int NOT NULL COMMENT 'Use minimum handling time [min_handling_time] and maximum handling time [max_handling_time] to help us give users accurate information about how long it will take for a product to arrive at its destination. Maximum and minimum handling time are the longest and shortest amounts of time between when an order is placed and when the product ships.',
  PRIMARY KEY (`shipping_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

